import React from "react";
import { Link } from "react-router-dom";
const nav = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to={"/"}>主頁</Link>
          </li>
          <li>
            <Link to={"/register"}>註冊</Link>
          </li>
          <li>
            <Link to={"/login"}>登入</Link>
          </li>
          <li>
            <Link to={"/login"}>個人頁面</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default nav;
